<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.1.3/dist/css/bootstrap.min.css" rel="stylesheet"
        integrity="sha384-1BmE4kWBq78iYhFldvKuhfTAU6auU8tT94WrHftjDbrCEXSU1oBoqyl2QvZ6jIW3" crossorigin="anonymous">
    <script>
        $(document).ready(function(){
            $("#showbtnjkt").click(function(){
                $("#jkt").show();
            });
            $("#hidebtnjkt").click(function(){
                $("#jkt").hide();
            });
            $("#showbtnsby").click(function(){
                $("#sby").show();
            });
            $("#hidebtnsby").click(function(){
                $("#sby").hide();
            });
        });
    </script>
    <title>Hide Show</title>
</head>

<body>
    <div class="container-fluid text-center bg-light p-5 mb-4">
        <h1>Photo Album</h1>
    </div>
    <div class="container-fluid">
        <div>
            <div class="mb-4">
                <h3>Jakarta</h3>
                <button id="showbtnjkt" class="btn btn-primary">Show</button>
                <button id="hidebtnjkt" class="btn btn-secondary">Hide</button>
            </div>
            <div id="jkt" class="row">
                <img class="col-md-4 mb-3" src="data:image/jpeg;base64,"
                    alt="jakarta1" height="200">
                <img class="col-md-4 mb-3" src="data:image/jpeg;base64,"
                    alt="jakarta2" height="200">
            </div>
        </div>
        <hr>
        <div>
            <div class="mb-4">
                <h3>Surabaya</h3>
                <button id="showbtnsby" class="btn btn-primary">Show</button>
                <button id="hidebtnsby" class="btn btn-secondary">Hide</button>
            </div>
            <div id="sby" class="row">
                <img class="col-md-4 mb-3" src="data:image/jpeg;base64,"
                    alt="surabaya1" height="200">
                <img class="col-md-4 mb-3" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTbmbHI5-WXECV50RzLFeGF0Nuzb1KL884Amw&usqp=CAU"
                    alt="surabayaw" height="200">
                <img class="col-md-4 mb-3" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRl7CL5n1ikY4PP51jthmEjTe5TMDrJXTSIGg&usqp=CAU"
                    alt="surabayae" height="200">
            </div>
        </div>
        <hr>
    </div>
</body>

</html>
